import React from "react";
import { MDBContainer } from "mdbreact";
import DocsLink from "../components/docsLink";

const com = () => {
  return (
    <MDBContainer className="mt-5">
      <DocsLink
        title="COM students"
    
      />
       <p className=" text-center font-weight-bold">
        OPPS!!<br></br>
        NO DATA
      </p>
      <p className="text-center font-weight-bold">
        "To be continued.."
      </p>
    </MDBContainer>
  );
}
export default com;
